    [],nt"num_tags": 7,nt"name": "bison-gis-data-analysis-protocol-fort-niobrara-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Standard operating procedure/protocol for
    analyzing GIS data for the Fort Niobrara National Wildlife Refuge bison herd.     This
    SOP is used in part of a study to analyze bison herd shifts, grazing, and movement
    patterns during the rut in July and August. If herd grazing and movements are significantly
    different during rut, this will imply the need to manage the herd differently during
    the rut months. This study has the potential to address two important points in
    bison conservation. Overall, this research will increase our current understanding
    of bison habitat use and carrying capacity in the national wildlife refuge system.
     This SOP covers computer methodology, and editing and checking out field data
    in ArcPad.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
